eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nvar skillContent = [{\n  title: 'Html 5',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Em agosto de 2022, tive meu primeiro contato com a programa\\xE7\\xE3o, come\\xE7ando a aprender HTML5. Essa experi\\xEAncia inicial me proporcionou uma base s\\xF3lida para entender a estrutura e a funcionalidade das p\\xE1ginas web.\\n      </span>\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Desde ent\\xE3o, venho aprimorando minhas habilidades em HTML5, focando na cria\\xE7\\xE3o de p\\xE1ginas e projetos que priorizam usabilidade e acessibilidade. Meu objetivo \\xE9 garantir que todos possam acessar e utilizar as minhas cria\\xE7\\xF5es de forma eficiente e intuitiva. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n      </span>\\n      <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            A cada projeto, procuro melhorar a qualidade e a experi\\xEAncia do usu\\xE1rio. A satisfa\\xE7\\xE3o de transformar ideias em realidades digitais me motiva a continuar desenvolvendo solu\\xE7\\xF5es pr\\xE1ticas e acess\\xEDveis. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n      </span>\\n\"\n}, {\n  title: 'Css 3',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Ainda em agosto de 2022, juntamente com minha introdu\\xE7\\xE3o ao HTML5, comecei a explorar o poder do CSS3, tornando-o uma parte essencial do meu kit de ferramentas de desenvolvimento web.\\n      </span>\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Durante esse per\\xEDodo inicial de aprendizado, aprofundei-me na cria\\xE7\\xE3o de estilos e layouts para websites e aplicativos, com um foco especial em Flexbox, Grid Layout e design responsivo. Esses conhecimentos me permitiram desenvolver interfaces visuais atraentes e funcionais. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n      </span>\\n      <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            Cada projeto que desenvolvo \\xE9 uma oportunidade de aplicar esses conhecimentos, garantindo que os sites atendam aos padr\\xF5es modernos de design e proporcionem uma experi\\xEAncia de usu\\xE1rio excelente em qualquer dispositivo. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n      </span>    \\n      \"\n}, {\n  title: 'Git',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            A partir de setembro de 2022, comecei meus estudos sobre controle de vers\\xE3o utilizando Git, uma ferramenta essencial na minha jornada de aprendizado. O Git transformou a maneira como gerencio e controlo as diferentes vers\\xF5es dos meus projetos.\\n          </span>   \\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Com o Git, aprendi a trabalhar de forma mais colaborativa e organizada em meus projetos. Ele me permite gerenciar o desenvolvimento de maneira estruturada, evitando perdas e mantendo sempre as vers\\xF5es anteriores dos meus c\\xF3digos. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n      </span>\\n      <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            O uso do Git n\\xE3o apenas melhora a qualidade do meu trabalho, mas tamb\\xE9m abre portas para novas oportunidades de crescimento e inova\\xE7\\xE3o no desenvolvimento de software. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n      </span>    \\n      \"\n}, {\n  title: 'GitHub',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Juntamente com o Git, estudei e dei meus primeiros passos na plataforma GitHub como parte essencial dos meus estudos sobre hospedagem e controle de vers\\xE3o.\\n      </span>\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Utilizando o GitHub, aprendi a gerenciar e compartilhar meus projetos de forma eficiente, garantindo uma colabora\\xE7\\xE3o mais fluida e um controle rigoroso das vers\\xF5es do c\\xF3digo. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n      </span>\\n      <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            O GitHub tem sido indispens\\xE1vel para minha jornada no mundo da programa\\xE7\\xE3o, e estou sempre aprimorando minhas habilidades nesta plataforma fundamental para desenvolvedores. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n      </span>\\n      \"\n}, {\n  title: 'Code',\n  content: \"\\n        <span class=\\\"skill-text-span paragraph\\\">\\n            Ol\\xE1, seja bem-vindo \\xE0 p\\xE1gina das minhas habilidades! Aqui est\\xE1 um resumo das minhas compet\\xEAncias e experi\\xEAncias em tecnologias essenciais para criar interfaces de usu\\xE1rio.\\n        </span>\\n        <span class=\\\"skill-text-span paragraph\\\">\\n            Explore \\xE0 vontade e sinta-se \\xE0 vontade para entrar em contato caso tenha alguma d\\xFAvida ou precise de mais informa\\xE7\\xF5es. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n        </span>\\n        <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            Estou aqui para compartilhar meu trabalho e colaborar em projetos futuros. Al\\xE9m disso, recomendo seguir a ordem deste menu para uma melhor experi\\xEAncia. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n        </span>    \\n      \"\n}, {\n  title: 'Figma',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            J\\xE1 dando um salto da programa\\xE7\\xE3o para o mundo do design, em novembro de 2022, iniciei meus estudos como designer de interface e experi\\xEAncia do usu\\xE1rio, utilizando o Figma como uma ferramenta essencial.\\n      </span>\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Dessa forma, crio meus prot\\xF3tipos pessoais, explorando os fundamentos do design UI/UX, complementando assim minhas habilidades como programador. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n      </span>\\n      <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            O Figma tem desempenhado um papel crucial ao visualizar e aprimorar minhas ideias, me auxiliando no desenvolvimento de designs funcionais e atraentes aos usu\\xE1rios. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n      </span>    \\n      \"\n}, {\n  title: 'JavaScript',\n  content: \"\\n        <span class=\\\"skill-text-span paragraph\\\">\\n            Ao final de novembro de 2022, tive meu primeiro contato com a linguagem de programa\\xE7\\xE3o JavaScript, iniciando uma emocionante jornada no mundo do desenvolvimento web.\\n        </span>\\n        <span class=\\\"skill-text-span paragraph\\\">\\n        Em meus projetos, tenho utilizado JavaScript para implementar t\\xF3picos avan\\xE7ados como a History API, permitindo a manipula\\xE7\\xE3o do hist\\xF3rico de navega\\xE7\\xE3o do usu\\xE1rio e a cria\\xE7\\xE3o de aplica\\xE7\\xF5es de p\\xE1gina \\xFAnica (SPAs) mais fluidas e responsivas. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n        </span>\\n        <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            Al\\xE9m disso, venho desenvolvendo p\\xE1ginas din\\xE2micas e incorporando atualiza\\xE7\\xF5es em tempo real, proporcionando uma experi\\xEAncia de usu\\xE1rio mais rica e interativa. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n        </span>\\n\\n      \"\n}, {\n  title: 'Sass',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Em agosto de 2023, tive meu primeiro contato com o pr\\xE9-processador Sass. Utilizando-o, consegui organizar e otimizar meu c\\xF3digo de maneira mais eficiente, tornando o processo de estiliza\\xE7\\xE3o mais \\xE1gil e produtivo.\\n      </span> \\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Com a utiliza\\xE7\\xE3o dos recursos como vari\\xE1veis, mixins e fun\\xE7\\xF5es, tenho conseguido criar estilos mais consistentes e reutiliz\\xE1veis, reduzindo a repeti\\xE7\\xE3o e facilitando a manuten\\xE7\\xE3o do c\\xF3digo. <span class=\\\"btn-show\\\" tabindex=\\\"0\\\">... Ver mais</span>\\n      </span> \\n      <span class=\\\"show-hide skill-text-span paragraph\\\">\\n            Cada nova aplica\\xE7\\xE3o de Sass em meus projetos me permite descobrir novas formas de aprimorar a efici\\xEAncia e a qualidade do desenvolvimento front-end. <span class=\\\"btn-hide\\\" tabindex=\\\"0\\\">... Ver menos</span>\\n      </span>    \\n      \"\n}, {\n  title: 'React',\n  content: \"\\n      <span class=\\\"skill-text-span paragraph\\\">\\n            Em mar\\xE7o de 2024, tive minha primeira experi\\xEAncia com React, um marco importante em minha jornada como desenvolvedor web front-end. Desde ent\\xE3o, tenho me dedicado a explorar profundamente os conceitos e a arquitetura desse framework, utilizando-o para criar interfaces de usu\\xE1rio din\\xE2micas e responsivas.\\n      </span>\\n      \"\n}];\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (skillContent);\n\n//# sourceURL=webpack://kelg-portf/./assets/js/pages/skill/skill-content.js?");

